function S_getUrl(r){var t=location.search;var n=t.substr(1);var e=n.split("&");for(var a in e){var i=e[a].split("=");if(i[0]==r){return i[1]}}return"paramName error"}var S_time=new function(){var r=new Date;this.getSimpleDate=function(){return r};this.getWeekdat=function(){return r.getDay()};this.getYear=function(){return r.getFullYear()};this.getMonth=function(){return r.getMonth()+1};this.getDay=function(){return r.getDate()};this.getHour=function(){return r.getHours()};this.getMin=function(){return r.getMinutes()};this.getSec=function(){return r.getSeconds()}};function S_sentry(r,t){if(!(t instanceof Array))return"arr is not array";var n;t[0]=r;n=t.length;while(t[n]!=r){n--}return n}function S_binarySearch(r,t){if(!(t instanceof Array))return"arr is not array";var n=0;var e=t.length;var a;while(n<=e){a=Math.floor((n+e)/2);if(t[a]<r){n=a+1}else if(t[a]>r){e=a-1}else{return a}}return 0}function S_bubbleSort(r){if(!(r instanceof Array))return"arr is not array";var t=true;for(var n=0;n<r.length-1&&t;n++){t=false;for(var e=r.length-1;e>=n;e--){if(r[e]<r[e-1]){var a=r[e];r[e]=r[e-1];r[e-1]=a;t=true}}}return r}function S_selectSort(r){if(!(r instanceof Array))return"arr is not array";for(var t=0;t<=r.length-1;t++){var n=t;for(var e=t+1;e<=r.length-1;e++){if(r[n]>r[e])n=e}if(t!=n){swap(r,t,n)}}return r}function S_quickSort(r){if(!(r instanceof Array))return"arr is not array";qsort(r,0,r.length-1);return r}function qsort(r,t,n){var e;if(t<n){e=Partition(r,t,n);qsort(r,t,e-1);qsort(r,e+1,n)}}function Partition(r,t,n){var e=r[t];while(t<n){while(t<n&&r[n]>=e)n--;swap(r,t,n);while(t<n&&r[t]<=e)t++;swap(r,t,n)}return t}function swap(r,t,n){var e=r[t];r[t]=r[n];r[n]=e;return r}var res=S_selectSort([2,6,3,7,1]);console.log(res);